let count = 0 ; 
const IncCount = ()=>{
    count++; 
    console.log("Incremented"+count);
} 
const DecCount = () =>{
    count-- ; 
    console.log("Decremented"+count) ; 
}

const App= ()=>{
    return(<div>
            <h1>Hello World </h1>
            <button onClick={IncCount}>increment</button>
            <button onClick={DecCount}>decrement</button>
         </div>
    ) ; 
}
export default App ;
